import React,{useContext} from 'react';
import {Link} from 'react-router-dom';
import {Grid, Card, Paper, Container }from '@material-ui/core';
import Typography from '@material-ui/core/Typography';
import {PropertyContext} from '../context/context';
import { makeStyles } from '@material-ui/core/styles';
import ButtonBase from '@material-ui/core/ButtonBase';
import img1 from "../images/room-1.jpeg";

const useStyles = makeStyles((theme) => ({
    Head:{
        color: "#F9F3FA",
        padding:10
    },
    Paper:{
        background:"#1C191D",
        borderRadius: 15,
    },
    root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    margin: 'auto',
    maxWidth: 500,
  },
  image: {
    width: 128,
    height: 128,
  },
  img: {
    margin: 'auto',
    display: 'block',
    maxWidth: '100%',
    maxHeight: '100%',
  },
  }));

export default function PropertyList() {
    const classes = useStyles();
    const context = useContext(PropertyContext)
    const images = context.initialData.map(card => card.images)
    console.log("items", images.map(card=> card[0].url))
    return (
        <div  >
            <Typography className={classes.Head}>15 Search result</Typography>
            <Grid container spacing={5}>
                {context.initialData.map((card)=>(
                    <Paper className={classes.paper}>
                    <Grid container spacing={2}>
                      <Grid item>
                        <ButtonBase className={classes.image}>
                          <img className={classes.img} alt="complex" src={img1}/>
                        </ButtonBase>
                      </Grid>
                      <Grid item xs={12} sm container>
                        <Grid item xs container direction="column" spacing={2}>
                          <Grid item xs>
                            <Typography gutterBottom variant="subtitle1">
                              Standard license
                            </Typography>
                            <Typography variant="body2" gutterBottom>
                              Full resolution 1920x1080 â€¢ JPEG
                            </Typography>
                            <Typography variant="body2" color="textSecondary">
                              ID: 1030114
                            </Typography>
                          </Grid>
                          <Grid item>
                            <Typography variant="body2" style={{ cursor: 'pointer' }}>
                              Remove
                            </Typography>
                          </Grid>
                        </Grid>
                        <Grid item>
                          <Typography variant="subtitle1">$19.00</Typography>
                        </Grid>
                      </Grid>
                    </Grid>
                  </Paper>
                      
                ))}
            </Grid>
        </div>
    )
}
